import axios from "axios";
const token =
	"pk.eyJ1IjoiYXJpc2FyZXMyMiIsImEiOiJja21hNHN4bncxbzN1Mm5wcnZqZmhmd245In0.mo6lAUdwinLZchtCADFthw";
const getAddress = async ({ coordinate }) => {
	const getData = () => {
		axios.get(
			`https://api.mapbox.com/geocoding/v5/mapbox.places/${coordinate}.json?access_token=${token}&types=poi&country=id&localregion=ID-JB`
		);
	};

	console.log("get data", getData);
	return <div></div>;
};

export default getAddress;
